package com.xiu.jd.bean.ware;

import java.io.Serializable;

public class JDAttribute implements Serializable {
	private static final long serialVersionUID = 2902222238665418317L;
	private Long aid;
	private String name;
	private Boolean keyProp;
	private Boolean saleProp;
	private Long indexId;
	private String status;
	private String attType;
	private Long inputType;
	private String options;
	private String req;
	private String fet;
	private String nav;
	private String cid;

	public JDAttribute() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Long getAid() {
		return aid;
	}

	public void setAid(Long aid) {
		this.aid = aid;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public Boolean getKeyProp() {
		return keyProp;
	}

	public void setKeyProp(Boolean keyProp) {
		this.keyProp = keyProp;
	}

	public Boolean getSaleProp() {
		return saleProp;
	}

	public void setSaleProp(Boolean saleProp) {
		this.saleProp = saleProp;
	}

	public Long getIndexId() {
		return indexId;
	}

	public void setIndexId(Long indexId) {
		this.indexId = indexId;
	}

	public String getStatus() {
		return status;
	}

	public void setStatus(String status) {
		this.status = status;
	}

	public String getAttType() {
		return attType;
	}

	public void setAttType(String attType) {
		this.attType = attType;
	}

	public Long getInputType() {
		return inputType;
	}

	public void setInputType(Long inputType) {
		this.inputType = inputType;
	}

	public String getOptions() {
		return options;
	}

	public void setOptions(String options) {
		this.options = options;
	}

	public String getReq() {
		return req;
	}

	public void setReq(String req) {
		this.req = req;
	}

	public String getFet() {
		return fet;
	}

	public void setFet(String fet) {
		this.fet = fet;
	}

	public String getNav() {
		return nav;
	}

	public void setNav(String nav) {
		this.nav = nav;
	}

	public String getCid() {
		return cid;
	}

	public void setCid(String cid) {
		this.cid = cid;
	}

	@Override
	public String toString() {
		return "JDAttribute [aid=" + aid + ", name=" + name + ", keyProp="
				+ keyProp + ", saleProp=" + saleProp + ", indexId=" + indexId
				+ ", status=" + status + ", attType=" + attType
				+ ", inputType=" + inputType + ", options=" + options
				+ ", req=" + req + ", fet=" + fet + ", nav=" + nav + ", cid="
				+ cid + "]";
	}
	
	

}
